import React from 'react'
import axios from 'axios'

function Product() {
	const url = 'https://5ef02ae0ad6d710016179f45.mockapi.io/api/v1/product/3'
	const [product, setProduct] = useState(null)
	axios.get(url)
				.then(response => {
					setProduct(response.data)
				})
	return(
			<div> 
				<h1 className="py-3">This is the product page</h1>
			</div>
		)
}

export default Product
